// Home.js

import React from "react";
import "../Styles/Home.css";
import aboutUsImage from "../Images/about_us.jpg";

function Home() {
  return (
    <div className="home-container">
      <div className="about-us">
        <h2>ABOUT US</h2>
        <div className="about-us-flexcontainer">
          <img src={aboutUsImage} alt="About Us" className="about-us-pic" />
          <div className="about-us-text">
            <p>
              SK Engineering Solutions LLC evolved with the simple idea of
              serving customers with the best products at competitive prices.
              With over 5 decades of experience in precision machining, casting,
              and forging, we have the capability to meet all customer needs.
              Our pillar for success lies in our enthusiasm for innovative
              solutions to serve customers. At SK Engineering Solutions LLC, we
              always engage in learning and implementing newer technology for
              constant optimization of our products.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
